/** @format */

import React from "react";
import Link from "next/link";
import { Menu } from "antd";
import {
  HomeOutlined,
  SearchOutlined,
  HeartOutlined,
  CarryOutOutlined,
  UserOutlined,
} from "@ant-design/icons";
import styled from "styled-components";

const NavLink = styled(Link)`
  text-align: center;
`;
// eslint-disable-next-line react/prop-types
const AppLayout = ({ children }) => {
  return (
    <div>
      {children}
      <Menu
        mode="inline"
        style={{ display: "flex", justifyContent: "space-between" }}
      >
        <Menu.Item>
          <NavLink href="/">
            <a>
              <HomeOutlined />
            </a>
          </NavLink>
        </Menu.Item>
        <Menu.Item>
          <Link href="/search">
            <a>
              <SearchOutlined />
            </a>
          </Link>
        </Menu.Item>
        <Menu.Item>
          <Link href="/favorite">
            <a>
              <HeartOutlined />
            </a>
          </Link>
        </Menu.Item>
        <Menu.Item>
          <Link href="/cart">
            <a>
              <CarryOutOutlined />
            </a>
          </Link>
        </Menu.Item>
        <Menu.Item>
          <Link href="/profile">
            <a>
              <UserOutlined />
            </a>
          </Link>
        </Menu.Item>
      </Menu>
    </div>
  );
};

export default AppLayout;
